import React from 'react'
import requestCards from '../assets/JsonData/requests-card-data.json'
import RequestCard from '../components/request-card/RequestCard'
const latestRequest = {
    header: [
        "serial",
        "Company",
        "Type",
        "Vacancy",
        "status"
    ],
    body: [
        {
            serial: "1",
            Company: "Abc pvt ltd",
            Vacancy: "17",
            Type: "Plumber",
            status: "rejected"
        },
        {
            serial: "2",
            Company: "frank iva",
            Vacancy: "16",
            Type: "painter",
            status: "hired"
        },
        {
            serial: "3",
            Company: "anthony bakers",
            Vacancy: "8",
            Type: "maison",
            status: "pending"
        },
        {
            serial: "4",
            Company: "frank iva",
            Vacancy: "4",
            Type: "plumber",
            status: "hired"
        },
        {
            serial: "5",
            Company: "anthony bakers",
            Vacancy: "2",
            Type: "carpenter",
            status: "rejected"
        }
    ]
}

const requestStatus = {
    "pending": "warning",
    "hired": "success",
    "rejected": "danger"
}

const renderRequestHead = (item, index) => (
    <th key={index}>{item}</th>
)

const renderRequestBody = (item, index) => (
    <tr key={index}>
        <td>{item.serial}</td>
        <td>{item.Company}</td>
        <td>{item.Type}</td>
        <td>{item.Vacancy}</td>
        <td>
            <Badge type={requestStatus[item.status]} content={item.status}/>
        </td>
    </tr>
)

export const Requests = () => {
   

    return (
        <div>
            <h2 className="page-header">Requests</h2>
            <div className="row">
                <div className="col-6">
                    <div className="row">
                        {
                            requestCards.map((item, index) => (
                                <div className="col-6" key={index}>
                                    <RequestCard
                                        icon={item.icon}
                                        count={item.count}
                                        title={item.title}
                                    />
                                </div>
                            ))
                        }
                    </div>
                </div>
                <div className="col-8">
                    <div className="card">
                        <div className="card__header">
                            <h3>latest requests</h3>
                        </div>
                        <div className="card__body">
                            <Table
                                headData={latestRequest.header}
                                renderHead={(item, index) => renderRequestHead(item, index)}
                                bodyData={latestRequest.body}
                                renderBody={(item, index) => renderRequestBody(item, index)}
                            />
                        </div>
                        <div className="card__footer">
                            <Link to='/'>view all</Link>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
